  width: 33.3333%;

  .imgwrap {
    width: 90px;
    margin-left: 25px;
    margin-top: 10px;

    img {
      width: 100%;
      height: auto;
    }
  }
}

.head_lnb {
  width: 33.3333%;

  ul {
    display: flex;
    justify-content: space-around;
    line-height: 70px;

    li {
      font-size: 20px;
      font-weight: bold;

      &:nth-child(4) {
        position: relative;

        &::before {
          content: "";
          display: block;
          width: 1px;
          height: 14px;
          background-color: #ccc;
          position: absolute;
          top: 25px;
          left: -35px;
        }
      }

      a {
        display: block;
        width: 100%;
        color: #fff;
        position: relative;
        transition: .3s;

        &:hover {
          color: #002053;

          &::after, &::before {
            width: 50%;
          }
        }

        &::after {
          display: block;
          content: "";
          width: 0%;
          height: 2px;
          background-color: #002053;
          position: absolute;
          bottom: 13px;
          right: 50%;
          transition: .3s;
        }

        &::before {
          display: block;
          content: "";
          width: 0%;
          height: 2px;
          background-color: #002053;
          position: absolute;
          bottom: 13px;
          left: 50%;
          transition: .3s;
        }
      }
    }
  }
}

.head_gnb {
  width: 33.3333%;

  ul {
    display: flex;
    justify-content: flex-end;

    li {
      margin-right: 25px;
      position: relative;

      &:nth-child(4) {}

