        color: #fff;
        font-size: 13px;
        position: absolute;
        top: 10px;
        right: -5px;
      }

      a {
        width: 100%;
        display: block;
        font-size: 25px;
        color: #fff;
        transition: .3s;
      }
    }
  }
}

